import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import Header from '../sharedpages/header';
import Navbar from '../sharedpages/navbar';
import Footer from '../sharedpages/footer';
import './ContentManagement.css';

const EditPrivacy = () => {
  const navigate = useNavigate();
  const [activeTab, setActiveTab] = useState('content');
  const [privacyContent, setPrivacyContent] = useState({
    dataCollection: '',
    cookieUsage: '',
    userRights: '',
    dataSecurity: '',
    thirdPartySharing: '',
    contactInfo: '',
    lastUpdated: new Date().toISOString().split('T')[0]
  });

  // Load existing privacy policy data from localStorage
  useEffect(() => {
    const loadPrivacyData = () => {
      const savedPrivacyData = localStorage.getItem('privacyPolicyData');
      if (savedPrivacyData) {
        try {
          const data = JSON.parse(savedPrivacyData);
          setPrivacyContent(data);
        } catch (error) {
          console.error('Error loading privacy data:', error);
        }
      } else {
        // Set default privacy policy content if none exists
        setPrivacyContent({
          dataCollection: 'We collect information that you provide directly to us, such as when you create an account, submit a property listing, or contact us for support.',
          cookieUsage: 'We use cookies and similar technologies to enhance your experience, analyze site usage, and provide personalized content.',
          userRights: 'You have the right to access, correct, or delete your personal information. You may also opt out of certain communications.',
          dataSecurity: 'We implement appropriate security measures to protect your personal information against unauthorized access, alteration, disclosure, or destruction.',
          thirdPartySharing: 'We do not sell, trade, or otherwise transfer your personal information to third parties without your consent, except as described in this policy.',
          contactInfo: 'For privacy-related questions or concerns, please contact us at privacy@valuez.com or call us at +65 6123 4567.',
          lastUpdated: new Date().toISOString().split('T')[0]
        });
      }
    };

    loadPrivacyData();
  }, []);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setPrivacyContent(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSaveChanges = () => {
    try {
      // Save privacy policy data to localStorage
      localStorage.setItem('privacyPolicyData', JSON.stringify(privacyContent));
      
      // Show success message
      alert('Privacy policy updated successfully!');
      
      // Navigate back to content management
      navigate('/dashboard/content-management');
    } catch (error) {
      console.error('Error saving privacy policy:', error);
      alert('Error saving privacy policy. Please try again.');
    }
  };

  const handleCancel = () => {
    navigate('/dashboard/content-management');
  };

  return (
    <div className="user-dashboard">
      <Header />
      <div className="user-dashboard-container">
        <Navbar activeTab={activeTab} setActiveTab={setActiveTab} />
        <main className="user-main-content">
          <div className="user-content-header">
            <div className="breadcrumb">
              Content Management / Privacy
            </div>
            <h1 className="user-main-title">Privacy</h1>
            <button 
              className="content-management-back-btn"
              onClick={handleCancel}
            >
              Back
            </button>
          </div>
          
          <div className="edit-privacy-content">
            <form className="edit-privacy-form">
              {/* Data Collection Section */}
              <div className="edit-privacy-form-section">
                <h2 className="edit-privacy-section-title">Data Collection</h2>
                <div className="edit-privacy-form-group">
                  <label htmlFor="dataCollection">What information do we collect?</label>
                  <textarea
                    id="dataCollection"
                    name="dataCollection"
                    value={privacyContent.dataCollection}
                    onChange={handleInputChange}
                    className="edit-privacy-form-textarea"
                    placeholder="Describe what personal information you collect from users..."
                    rows="4"
                  />
                </div>
              </div>

              {/* Cookie Usage Section */}
              <div className="edit-privacy-form-section">
                <h2 className="edit-privacy-section-title">Cookie Usage</h2>
                <div className="edit-privacy-form-group">
                  <label htmlFor="cookieUsage">How do we use cookies?</label>
                  <textarea
                    id="cookieUsage"
                    name="cookieUsage"
                    value={privacyContent.cookieUsage}
                    onChange={handleInputChange}
                    className="edit-privacy-form-textarea"
                    placeholder="Explain your cookie policy and how cookies are used..."
                    rows="4"
                  />
                </div>
              </div>

              {/* User Rights Section */}
              <div className="edit-privacy-form-section">
                <h2 className="edit-privacy-section-title">User Rights</h2>
                <div className="edit-privacy-form-group">
                  <label htmlFor="userRights">What are your rights?</label>
                  <textarea
                    id="userRights"
                    name="userRights"
                    value={privacyContent.userRights}
                    onChange={handleInputChange}
                    className="edit-privacy-form-textarea"
                    placeholder="Describe user rights regarding their personal data..."
                    rows="4"
                  />
                </div>
              </div>

              {/* Data Security Section */}
              <div className="edit-privacy-form-section">
                <h2 className="edit-privacy-section-title">Data Security</h2>
                <div className="edit-privacy-form-group">
                  <label htmlFor="dataSecurity">How do we protect your data?</label>
                  <textarea
                    id="dataSecurity"
                    name="dataSecurity"
                    value={privacyContent.dataSecurity}
                    onChange={handleInputChange}
                    className="edit-privacy-form-textarea"
                    placeholder="Explain your data security measures..."
                    rows="4"
                  />
                </div>
              </div>

              {/* Third Party Sharing Section */}
              <div className="edit-privacy-form-section">
                <h2 className="edit-privacy-section-title">Third Party Sharing</h2>
                <div className="edit-privacy-form-group">
                  <label htmlFor="thirdPartySharing">Do we share your information?</label>
                  <textarea
                    id="thirdPartySharing"
                    name="thirdPartySharing"
                    value={privacyContent.thirdPartySharing}
                    onChange={handleInputChange}
                    className="edit-privacy-form-textarea"
                    placeholder="Explain your policy on sharing data with third parties..."
                    rows="4"
                  />
                </div>
              </div>

              {/* Contact Information Section */}
              <div className="edit-privacy-form-section">
                <h2 className="edit-privacy-section-title">Contact Information</h2>
                <div className="edit-privacy-form-group">
                  <label htmlFor="contactInfo">How to contact us about privacy?</label>
                  <textarea
                    id="contactInfo"
                    name="contactInfo"
                    value={privacyContent.contactInfo}
                    onChange={handleInputChange}
                    className="edit-privacy-form-textarea"
                    placeholder="Provide contact information for privacy inquiries..."
                    rows="4"
                  />
                </div>
              </div>

              {/* Last Updated Section */}
              <div className="edit-privacy-form-section">
                <h2 className="edit-privacy-section-title">Last Updated</h2>
                <div className="edit-privacy-form-group">
                  <label htmlFor="lastUpdated">When was this policy last updated?</label>
                  <input
                    type="date"
                    id="lastUpdated"
                    name="lastUpdated"
                    value={privacyContent.lastUpdated}
                    onChange={handleInputChange}
                    className="edit-privacy-form-input"
                  />
                </div>
              </div>

              {/* Form Actions */}
              <div className="edit-privacy-form-actions">
                <button 
                  type="button" 
                  className="edit-privacy-btn-cancel" 
                  onClick={handleCancel}
                >
                  Cancel
                </button>
                <button 
                  type="button" 
                  className="edit-privacy-btn-save"
                  onClick={handleSaveChanges}
                >
                  Save Changes
                </button>
              </div>
            </form>
          </div>
        </main>
      </div>
      <Footer />
    </div>
  );
};

export default EditPrivacy;
